import "./featured.scss"

export default function Featured() {
  return (
    <div className="featured">
        <img src="https://i.ytimg.com/vi/QWZuGneOh-k/maxresdefault.jpg" alt="" />

        <div className="info">
            <img src="https://i.ytimg.com/vi/QWZuGneOh-k/maxresdefault.jpg" alt="" />
            <span className="desc"></span>
        </div>
    </div>
  )
}
